import { Carousel } from "antd";

const onChange = (current: number): void => {
  console.log(current);
};

export const HomeCarousel = () => (
  <Carousel afterChange={onChange}>
    <div>
      <h3>1</h3>
    </div>
    <div>
      <h3>2</h3>
    </div>
    <div>
      <h3>3</h3>
    </div>
    <div>
      <h3>4</h3>
    </div>
  </Carousel>
);
